import { createSlice } from '@reduxjs/toolkit';

const tableDataSlice = createSlice({
    name: 'tableData',
    initialState: [{
        id: 1,
        title: "Какашка",
        description: "БОООЛЬШАЯ КАКАШКА"
    }],
    reducers: {
        tableDataAdded(state, action) {
            state.push({
                id: action.payload.id,
                text: action.payload.text
            })
        },
    }
})

export const { tableDataAdded } = tableDataSlice.actions
export default tableDataSlice.reducer
